def find_trend_reversals(arr):
    reversals = []
    for i in range(1, len(arr)):
        if (arr[i] > arr[i-1] ):
            reversals.append(i)
    return reversals

def split_by_reversals(arr, reversals):
    segments = []
    start = 0
    for end in reversals:
        segments.append(arr[start:end])
        start = end
    segments.append(arr[start:])
    return segments

def process_sequences(arr1, arr2):
    reversals = find_trend_reversals(arr1)
    segments1 = split_by_reversals(arr1, reversals)
    segments2 = split_by_reversals(arr2, reversals)
    return reversals, segments1, segments2
