import matplotlib.pyplot as plt

def plot_arrays(arrays1, arrays2):
    # Filter out groups with fewer than 50 data points
    filtered_data = [
        (arr1, arr2) for arr1, arr2 in zip(arrays1, arrays2) if len(arr1) >= 50 and len(arr2) >= 50
    ]

    # Unpack the filtered data
    filtered_arrays1, filtered_arrays2 = zip(*filtered_data) if filtered_data else ([], [])

    # Total number of arrays
    num_arrays = len(filtered_arrays1)

    if num_arrays == 0:
        print("No groups have more than 50 data points.")
        return

    # Determine the grid size dynamically
    num_cols = 4
    num_rows = (num_arrays + num_cols - 1) // num_cols  # Round up to get rows needed

    # Create the grid of subplots
    fig, axes = plt.subplots(num_rows, num_cols, figsize=(15, 3 * num_rows))

    # Flatten axes for easy iteration if there are multiple rows
    axes = axes.flatten()

    # Iterate over each pair of arrays
    for i, (arr1, arr2) in enumerate(zip(filtered_arrays1, filtered_arrays2)):
        # Plot the first array with a thinner line
        axes[i].plot(arr1, label='True value', linewidth=1)

        # Plot the second array with a marker
        axes[i].plot(arr2, '.', label='Predicted value', markersize=2)

        # Add a legend
        axes[i].legend(fontsize=8)

        # Add axis labels
        axes[i].set_xlabel('Working cycles', fontsize=8)
        axes[i].set_ylabel('Remaining discharging cycles', fontsize=8)
        axes[i].set_title(f'TestCell_{i + 1}', fontsize=10)

        # Set consistent limits for the y-axis
        axes[i].set_xlim([0, len(arr1)])
        axes[i].set_ylim([min(min(arr1), min(arr2)), max(max(arr1), max(arr2))])

    # Hide unused subplots
    for j in range(i + 1, len(axes)):
        fig.delaxes(axes[j])

    # Adjust layout for better spacing
    plt.tight_layout()
    plt.show()

