import matplotlib.pyplot as plt
import numpy as np

def plot_difference_boxplot(segments1, segments2):
    # Check if both lists have the same length
    if len(segments1) != len(segments2):
        raise ValueError("segments1 and segments2 must have the same length.")

    # Filter out groups with less than 50 data points and keep indices
    filtered_segments1 = []
    filtered_segments2 = []
    for seg1, seg2 in zip(segments1, segments2):
        if len(seg1) >= 50 and len(seg2) >= 50:
            filtered_segments1.append(seg1)
            filtered_segments2.append(seg2)

    # Calculate differences and MAE for each pair of arrays, and ensure they are 1D
    differences = []
    maes = []
    for seg1, seg2 in zip(filtered_segments1, filtered_segments2):
        diff = np.squeeze(np.array(seg1)) - np.squeeze(np.array(seg2))
        if diff.ndim > 1:
            raise ValueError("All differences must be 1-dimensional")
        differences.append(diff)
        mae = np.mean(np.abs(diff))
        maes.append(mae)

    # Initialize the plot with a larger figure size
    fig, ax = plt.subplots(figsize=(16, 9))

    # Create boxplot for the differences
    ax.boxplot(differences, patch_artist=True)

    # Add MAE text above each box with very small font size
    for i, mae in enumerate(maes):
        ax.text(i + 1, mae + 150, f'{int(mae)}', ha='center', va='bottom', color='red', fontsize=8)

    # Add axis labels and title
    ax.set_xlabel('Filtered Array Pairs')
    ax.set_ylabel('Difference in Values')
    ax.set_title('Box Plot of Differences Between Filtered Array Pairs with MAE Indicators')

    # Optimize layout and show plot
    plt.tight_layout()
    plt.show()

