from tensorflow.keras.constraints import Constraint
class CustomConstraint(Constraint):
    def __call__(self, w):
        return tf.clip_by_value(w, clip_value_min=0.0001, clip_value_max=0.2)
class SEIgrowthmodel2(tf.keras.layers.Layer):
    def __init__(self, units,J=1.9e-4,H=11, Kcrd=1.0,alpha=0.69,nn=20,F=9.6485,R=8.1345,f=1.1e3,vol=1.04e-9,Area=78.5,episo=1.0, **kwargs):
        super(SEIgrowthmodel2, self).__init__(**kwargs)
        self.units = units
        self.J0=J
        self.H0=H
        self.Kcrd0=Kcrd
        self.alpha0=alpha
        self.nn0=nn
        self.F0=F
        self.R0=R
        self.f0=f
        self.vol0=vol
        self.Area0=Area
        self.episo0=episo

    def build(self, input_shape):
        if isinstance(input_shape, list):
        # If there are multiple inputs, process each input's shape separately
        # Here, I'm assuming you want to use the feature dimension of the first input
        # Adjust as necessary for your specific use case
            feature_dim = input_shape[0][-1]
        else:
        # For a single input, just use the last dimension of the input shape
            feature_dim = input_shape[-1]
    # Now define your weight matrix with the correct dimensions
        self.Q_sei = self.add_weight(name='Q_sei',
                                 shape=(feature_dim, self.units),
                                 initializer='uniform',
                                 trainable=True,
                                 constraint=CustomConstraint())
        # D0, Ea, and kB as scalar biases
        self.Kcrd_bias = self.add_weight(name='Kcrd',
                                 shape=(self.units,),
                                 initializer='zeros',
                                 trainable=True,
                                 )
        self.episo_bias = self.add_weight(name='episo',
                                 shape=(self.units,),
                                 initializer='zeros',
                                 trainable=True,
                                 )
        self.J_bias = self.add_weight(name='J',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.J0),
                                       trainable=False)
        self.H_bias= self.add_weight(name='H',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.H0),
                                       trainable=False)
        self.Kcrd_bias= self.add_weight(name='Kcrd',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.Kcrd0),
                                       trainable=False)
        self.alpha_bias= self.add_weight(name='alpha',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.alpha0),
                                       trainable=False)
        self.nn_bias= self.add_weight(name='nn',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.nn0),
                                       trainable=False)
        self.F_bias= self.add_weight(name='F',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.F0),
                                       trainable=False)
        self.R_bias= self.add_weight(name='R',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.R0),
                                       trainable=False)
        self.f_bias= self.add_weight(name='f',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.f0),
                                       trainable=False)
        self.vol_bias= self.add_weight(name='vol',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.vol0),
                                       trainable=False)
        self.Area_bias= self.add_weight(name='Area',
                                       shape=(1,),
                                       initializer=tf.constant_initializer(self.Area0),
                                       trainable=False)


    def call(self, inputs):
        inputs_in_celsius = tf.squeeze(inputs[0], axis=1)  # New shape: [None, 2500]
        inputs_in_current = tf.squeeze(inputs[1], axis=1)  # New shape: [None, 2500]
        inputs_in_current = tf.expand_dims(inputs_in_current, -1)  # Shape becomes [None, 2500, 1]
        inputs_in_celsius = tf.expand_dims(inputs_in_celsius, -1)  # Shape becomes [None, 2500, 1]

    # Ensure that self.Q_sei is compatible with inputs_in_current for operations
    # Possible reshaping or adjustment of self.Q_sei, depending on your model's requirements
    # For example, if self.Q_sei needs to be transposed or broadcasted

    # Adjusted calculation

    def call(self, inputs):
        epsilon = tf.keras.backend.epsilon()

        inputs_in_celsius = tf.squeeze(inputs[0], axis=1)  # New shape: [None, 2500]
        inputs_in_current = tf.squeeze(inputs[1], axis=1)  # New shape: [None, 2500]
        inputs_in_current = tf.expand_dims(inputs_in_current, -1)  # Shape becomes [None, 2500, 1]
        inputs_in_celsius = tf.expand_dims(inputs_in_celsius, -1)  # Shape becomes [None, 2500, 1]
        inputs_in_current =tf.abs(inputs_in_current)+0.1
        inputs_in_celsius =tf.abs(inputs_in_celsius)+0.1
        # Adjusted calculation with additional epsilon to avoid NaNs
        exp_term = tf.math.exp(self.alpha_bias * self.nn_bias ** self.F_bias / (self.R_bias * inputs_in_celsius + epsilon))
        power_term = tf.pow(tf.abs(self.Q_sei)+0.01, (self.J_bias * self.f_bias))
        reciprocal_current = tf.math.reciprocal_no_nan(inputs_in_current )

        denominator =  reciprocal_current * power_term + epsilon
        numerator = inputs_in_current * self.J_bias * (1 + self.H_bias * self.Kcrd_bias) + epsilon

        dsdt = numerator * tf.math.reciprocal_no_nan(denominator+ 0.1)
        dsdt = numerator * denominator
        dsdt *= self.vol_bias / (self.Area_bias * (1 - self.episo_bias) + epsilon)

        return tf.nn.relu6(dsdt)
def tensor_diff(tensor, axis=1):
    """
    Calculate the difference of a tensor along a specified axis.
    Equivalent to numpy.diff() for tensors.
    """
    # Get slices of the tensor from the start to the second-to-last element and from the second element to the end
    tensor_start = tensor[..., :-1] if axis == -1 else tensor[..., :tensor.shape[axis] - 1]
    tensor_end = tensor[..., 1:] if axis == -1 else tensor[..., 1:tensor.shape[axis]]

    # Compute the difference
    return tensor_end - tensor_start
# Example usage
# Assuming time_series_transposed is your tensor and you want to calculate the difference along axis 1
class TimeIntegrationLayer(Layer):
    def __init__(self, **kwargs):
        super(TimeIntegrationLayer, self).__init__(**kwargs)

    def call(self, inputs):
        hidden_output, time_series = inputs

        # Assuming hidden_output shape: [batch_size, time_steps, features]
        # Assuming time_series shape: [batch_size, 1, time_steps]

        # Slice hidden_output to start from the second element in the time dimension
        hidden_output_sliced = hidden_output[:, 1:, :]

        # Transpose time_series to align with hidden_output for multiplication
        # New shape of time_series: [batch_size, time_steps, 1]
        time_series_transposed = tf.transpose(time_series, perm=[0, 2, 1])

        # Element-wise multiplication
        # Now, both tensors are compatible for broadcasting
        multiplied = hidden_output_sliced * time_series_transposed

        # Integrate (sum) over the time axis (axis=1)
        integrated = tf.reduce_sum(multiplied, axis=1)

        return integrated

